import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Make sure you have a CSS file for your Navbar styles

function Navbar() {
  const [isOpen, setIsOpen] = useState(false); // State for mobile menu toggle

  const toggleMenu = () => {
    setIsOpen(!isOpen); // Toggle menu open/close
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand">
        <h1>NASA Explorer</h1>
      </div>
      <div className={`navbar-links ${isOpen ? 'open' : ''}`}>
        <ul>
          <li><Link to="/apod">APOD</Link></li>
          <li><Link to="/mars-photos">Mars Photos</Link></li>
          <li><Link to="/epic-images">EPIC Images</Link></li>
          <li><Link to="/neo">Near Earth Objects</Link></li>
          <li><Link to="/nasa-library">NASA Library</Link></li>
        </ul>
      </div>
      <div className="navbar-toggle" onClick={toggleMenu}>
        {/* This div will be the button to toggle the menu */}
        <span className="bar"></span>
        <span className="bar"></span>
        <span className="bar"></span>
      </div>
    </nav>
  );
}

export default Navbar;
